import "./Todo.css"

import React, { useEffect, useState } from 'react'
 import {useNavigate } from "react-router-dom"
import axios from "axios"
function Todo() {
const [commingdata, setcommingdata] = useState([])
    useEffect(() => {
       axios.get('http://localhost:3001/data').then((result)=>{
        setcommingdata(result)
        console.log(result)
    })
    }, [])
    
  const [todo, settodo] = useState('')
  const navigate=useNavigate()
  function handlesubmit(){
   console.log("callinn....")
   axios.post('http://localhost:3001/',{todo:todo}).then((result)=>{
    console.log(result);
    navigate('/')
   })
  }

  console.log(todo);
    return (
    <div className="todoparant">
        <h1 className="headingtodo">Todo List</h1>
        
           <input onChange={(e)=>{
            settodo(e.target.value)
           }} className="inputtext" type="text" />
           <button onClick={()=>{ {todo=='' ? alert("not value added"):handlesubmit()}}} className="button">Add</button>

           <div>
           <ul id="myUL">
  <li>Hit the gym</li>
  <li class="checked">Pay bills</li>
  <li>Meet George</li>
  <li>Buy eggs</li>
  <li>Read a book</li>
  <li>Organize office</li>
</ul>
           </div>
    </div>
  )
}

export default Todo
